import React from "react";
import Header from "./Header.jsx"
import Footer from "./Footer.jsx"
import Note from "./Note.jsx"
import notes from "../notes.js";

function createKeep(keepitems){
    return <Note title = {keepitems.title} body ={keepitems.content}
         />
}

function App(){
    return <div>
        <Header />
        {notes.map(createKeep)}
        <Footer />
    </div>
}

export default App;
